import {ContextVeiris, ContextVerisi} from "./Main"


const Nav=(props)=>{
    return (
        <div className="Nav" >
            Nav
            <br/>
            {props.title}
            <br/>
            {props.employe.isim}
            <br/>
            {useContext(ContextVeiris)}
        </div>
    )
}


export default Nav;
